import { Template } from 'meteor/templating';
import { ReactiveVar } from 'meteor/reactive-var';

import './main.html';

Meteor.startup(() => {
		Meteor.call('removeAllPosts');
		Devices.insert({name: "device1"});
		Devices.insert({name: "device2"});
		Devices.insert({name: "device3"});
		Devices.insert({name: "device4"});
		Devices.insert({name: "device5"});
});

Template.deviceList.helpers({
	'devices': function(){
		return Devices.find({});
	}
});
